    state = {
        account:null,
        drawerVisible:true,
        drawerContent:null
      };

componentDidMount() {
    axios.get('http://localhost:3000/Account',{ withCredentials: true  })
    .then(res => {
    if(res) {

      const res_data = res.data;
      this.setState({ account: (res.data) })
      console.log(this.state.account)

    }

    }).catch((error) => {
        console.log(error); //Logs a string: Error: Request failed with status code 404
      //  window.location.href='/auth';

      });

  }

  toggleDrawer(e){
      this.setState({drawerVisible:!drawerVisible});
  }


  render() {
    return (<div>
      home
      <div heigh='500px'>
      <EatingCalendar toggleDrawer={this.toggleDrawer} eating_data={(this.state.account ? this.state.account.activity_data.alcohol_data:{}) }
      />
      <Drawer
        isVisible={this.state.drawerVisible}
        >
            {this.state.drawerContent}
            </Drawer>
      </div>
    </div>

    );
  }
}
export default home
